import React from "react";
import Table from 'react-bootstrap/Table';
import {allFlights} from '../AirData';
import '../App.css';

const allFlight = () => {
    const keys = Object.keys(allFlights);
    return (
        <div>
            <Table bordered id = "table1">
                <thead>
                    <tr>
                        <th>Flight Code</th>
                        <th>Description</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        keys.map(data_key => (
                        <tr>
                          <td>{allFlights[data_key].flightCode}</td>
                          <td>{allFlights[data_key].description}</td>
                        </tr>
                    ))
                    }
                </tbody>
            </Table>
        </div>
    );
}
export default allFlight;
